(1, '2016-01-23 18:54:23', '[GoPantanal] - Email de teste para entrada', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 25, 'Para compartilhar esse conteúdo, por favor utilize o link\r\nhttp://www1.folha.uol.com.br/poder/2016/01/1732712-filho-de-lula-nao-tem-obrigacao-de-abrir-dados-diz-advogado.shtml\r\nou as ferramentas oferecidas na página. Textos, fotos, artes e vídeos da\r\nFolha estão protegidos pela legislação brasileira sobre direito autoral.\r\nNão reproduza o conteúdo do jornal em qualquer meio de comunicação,\r\neletrônico ou impresso, sem autorização da Folhapress (\r\npesquisa@folhapress.com.br). As regras têm como objetivo proteger o\r\ninvestimento que a Folha faz na qualidade de seu jornalismo. Se precisa\r\ncopiar trecho de texto da Folha para uso privado, por favor logue-se como\r\nassinante ou cadastrado.\r\n', 1),
(6, '2016-01-26 00:14:26', '[TESTE] - Active Record Class', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 28, 'Active Record Class\r\n\r\nCodeIgniter uses a modified version of the Active Record Database Pattern.\r\nThis pattern allows information to be retrieved, inserted, and updated in\r\nyour database with minimal scripting. In some cases only one or two lines\r\nof code are necessary to perform a database action. CodeIgniter does not\r\nrequire that each database table be its own class file. It instead provides\r\na more simplified interface.\r\n\r\nBeyond simplicity, a major benefit to using the Active Record features is\r\nthat it allows you to create database independent applications, since the\r\nquery syntax is generated by each database adapter. It also allows for\r\nsafer queries, since the values are escaped automatically by the system.\r\n*Note:* If you intend to write your own queries you can disable this class\r\nin your database config file, allowing the core database library and\r\nadapter to utilize fewer resources.\r\n', 1),
(7, '2016-01-26 00:19:58', 'Fwd: [MANANCIAL DA VIDA] - Discipulado', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 30, '---------- Forwarded message ---------\r\nFrom: Jorge Luiz Gomes da Silva <jorge.silva.msbr@gmail.com>\r\nDate: seg, 25 de jan de 2016 às 20:17\r\nSubject: [MANANCIAL DA VIDA] - Discipulado\r\nTo: [Leaf] - Jorge Silva <jorge@leafweb.com.br>\r\n\r\n\r\n\r\n\r\n---------- Forwarded message ---------\r\nFrom: Natan Leitte <natanleitte@gmail.com>\r\nDate: seg, 25 de jan de 2016 às 16:48\r\nSubject: Re: [MANANCIAL DA VIDA] - Discipulado\r\nTo: Jorge Luiz Gomes da Silva <jorge.silva.msbr@gmail.com>\r\n\r\n\r\nCara, vou mexer neste material. Mas como te disse ele ainda não está\r\npronto. Então vou lhe enviar. Ele é de autoria do Pr. Nelson da IB\r\nIndependente, é estes que eles usam nos grupos de evangelismo.\r\n\r\nEnquanto não concluo a edição do nosso, utilize este como ESBOÇO. Ele está\r\nem formato de lição, mas possui um esboço aceitável. à partir da página 6\r\nvocê verá isso.\r\n\r\nO nosso vai ser composto pelo\r\n1. estudo sobre salvação que você já usou,\r\n2. Segurança da Salvação,\r\nPrimeiros passos com Jesus\r\n3. Oração\r\n4. Bíblia\r\n5. Igreja: A importância da vida em comunidade\r\n\r\nPeço, inclusive sua ajuda e valiosa contribuição. Se tiver algum esboço que\r\nescreveu ou algo que acha de importância colocar neste material, vai\r\ncompondo aí que a gente depois junta pra ficar um material legal pra\r\nutilizarmos para a nossa comunidade. Vai ser uma benção.\r\n\r\nSe achar bom também, pode utilizar o ESBOÇO da primeira lição da nova vida\r\nem Cristo. conforme entender a necessidade do seu público.\r\n\r\nAbraço\r\n\r\nEm 25 de janeiro de 2016 10:56, Jorge Luiz Gomes da Silva <\r\njorge.silva.msbr@gmail.com> escreveu:\r\n\r\n> E ae manim,\r\n>\r\n> Queria pedir para você o restante dos estudos de discipulado, se der para\r\n> você passar completo melhor que dae eu vou estudando :)\r\n>\r\n>\r\n> vlws\r\n>\r\n\r\n\r\n\r\n-- \r\nAtenciosamente,\r\n\r\nNatan Leite\r\n', 1),
(8, '2016-01-26 00:21:27', 'Fwd: ISIS ameaça Israel', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 31, '---------- Forwarded message ---------\r\nFrom: Chamad@ Urgente <novidades@apazmail.com.br>\r\nDate: seg, 25 de jan de 2016 às 20:13\r\nSubject: ISIS ameaça Israel\r\nTo: Chamad@ Urgente Subscriber <jorge.silva.msbr@gmail.com>\r\n\r\n\r\nSe você não conseguir visualizar o email, clique aqui\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/166617801051/jorge.silva.msbr/gmail.com/>\r\n.\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/677919051068/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/677919051068/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/715725379752/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/854068141609/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/238200473163/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/459074964147/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/778646231746/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/435372805090/jorge.silva.msbr/gmail.com/>\r\n<http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/228715769722/jorge.silva.msbr/gmail.com/>\r\n\r\n*Por favor, não responda diretamente a esta mensagem.*\r\n\r\n   - Para falar conosco, clique aqui.\r\n   <http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/736579386445/jorge.silva.msbr/gmail.com/>\r\n   - Para fazer uma nova assinatura deste boletim, clique aqui\r\n   <http://www.chamada.com.br/cgi-bin/dada/mail.cgi/r/chamadaurgente/860313296801/jorge.silva.msbr/gmail.com/>\r\n   .\r\n   - P